create table Employee(
Employee_ID varchar(20) not Null,
full_name varchar(50),
Manager varchar(30),
partner varchar(30),
Experience int,
store_id varchar(10),
primary key(Employee_ID),
foreign key(store_id) references store_location(store_id)
);


create table Orders (
Order_ID varchar(10) not Null,
customer_id varchar(20),
Order_Date date,
Payment_Type varchar(30),
employee_id varchar(20),
store_id varchar(10),
primary key(Order_ID),
foreign key(Employee_ID) references Employee(Employee_ID),
foreign key(customer_id) references reward_members(customer_id),
foreign key(store_id) references store_location(store_id)
);


create table Order_Line (
orderline_id varchar(10) not Null,
sizes int,
product_id varchar(10),
order_id varchar(10),
primary key(orderline_id),
foreign key (order_id) references orders(order_id),
foreign key (product_id) references product(product_id)
);


create table product (
product_id varchar(10),
primary key(product_id)
);

create table reward_members(
customer_id varchar(10) not Null,
Email varchar(100),
phone varchar(10),
full_name varchar(30),
street varchar(100),
city varchar(30),
state varchar(20),
primary key(customer_id)
);


create table store_location(
store_id varchar(10) not Null,
city varchar(50),
street varchar(100),
revenue money,
sales_qty int,
phone_number varchar(10),
primary key(store_id)
);


--created a new column for the Primary key
create table drinks(
drinks_id varchar(10) not null,
item varchar(50),
temperature int,
primary key(drinks_id)
);



--created a new column for the Primary key
create table food(
food_id varchar(10) not Null,
variety varchar(50),
expiration_date date,
refridgerated boolean,
primary key(food_id)
);


create table customizations(
customization_id varchar(10) not null,
dairy_product varchar(30),
sprinkles boolean,
primary key(customization_id)
);

create table merchandise(
merchandise_id varchar(10),
item varchar(30),
primary key(merchandise_id)
);
























